import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Nav extends Component {
    render() {
        return (

            <div className="row menuSegundario justify-content-center d-flex">
                <div className="col-6 my-2 justify-content-center d-flex">
                    <nav className="nav flex-column d-block ">
                            <Link to={'/Pasteles'}> <button type="button" className="btn btn-success text-white mb-1 d-block"> Pasteles </button> </Link>
                            <Link to={'/Galletas'}> <button type="button"className="btn btn-success text-white mb-1 btn-block"> Galletas </button></Link>
                            <Link to={'/Cremas Dulces'}> <button type="button"className="btn btn-success text-white mb-1" > Cremas Dulces  </button></Link>
                            <Link to={'/Bizcochos'}> <button type="button"className="btn btn-success text-white mb-1 btn-block" >Bizcochos </button> </Link>
                            <Link to={'/Magdalenas'}> <button type="button"className="btn btn-success text-white mb-1 btn-block" > Magdalenas  </button> </Link>
                            <Link to={'/Mousse'}> <button type="button"className="btn btn-success text-white mb-1 btn-block" > Mousse  </button> </Link>
                            <Link to={'/Recetas Faciles'}> <button type="button"className="btn btn-success text-white mb-1 btn-block"> Recetas Faciles </button> </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Nav;
